import React from 'react';

const Testsets = props => {
  return(
    <div className="appContent">
      <div className="columns">
        <div className="column is-3">
          <div className="card">
            <header className="card-header">
              <p className="card-header-title">Testsets</p>
            </header>
            <div className="card-table">
              <div className="content">
                <table className="table is-fullwidth is-striped">
                  <tbody>
                    {
                      props.sets.map(testset => {
                        return (
                          <tr className="dataList">
                            <td><i class="fas fa-object-group"></i></td>
                            <td>{testset.name}</td>
                            <td className="level-right"><p className="button is-primary">{testset.feature}</p></td>
                          </tr>
                        );
                      })
                    }
                  </tbody>
                </table>
              </div>
            </div>
            <footer className="card-footer"></footer>
          </div>
        </div>
        <div className="column is-9"></div>
      </div>
    </div>
  );
}

export default Testsets;
